// 智能合约的许可协议
// SPDX-License-Identifier: GPL-3.0-or-later

pragma solidity ^0.8.7;
import {Action,baseproposal} from "./newContracts/baseproposal.sol";

contract teachingSchedule {
    enum teacherKind{
        TEACHER,
        AI
    }

    enum VoteChoice {
        Approval,
        Reject,
        abstain
    }

    struct Teacher {
        teacherKind kind;
        uint8 id;
        string name;
        address teacherAddress;
        uint8[] assignedCourses;   // 已分配的课程
        uint8 token;
        bool[] voted; // 是否投票
        VoteChoice[] choice; // 每个提案的投票结果
    }

    struct Course {
        uint8 id;
        string name;
        mapping(uint8 => uint8) suitabilityToTeacher; // 课程适合教师的程度（1-10）
    }

    // 主题集合
    baseproposal[] public proposals;


    mapping(address => Teacher) public teachers;
    mapping(uint8 => address) public id2TeacherAddress;
    mapping(uint8 => Course) public courses;

    uint8 public teacherCount = 0;
    uint8 public aiCount = 0;
    uint8 public courseCount = 0;


    constructor(){
    }

    // 返回主题集合
    function proposalList() public view returns (baseproposal[] memory) {
        return proposals;
    }

    function createProposal(
        string memory _name, 
        string memory _discription,
        uint8 _proposalKind,
        uint8 _proposalStatus,
        uint _startTime,
        uint _endTime
    ) public {
        baseproposal new_proposal = new baseproposal(
            _name, _discription, _proposalKind, _proposalStatus, _startTime, _endTime
        );
        proposals.push(new_proposal);
        for (uint8 i = 1; i <= teacherCount; i++) {
            // 如果该地址已经投过票 不处理，未投过票 赋予权
            address now_address = id2TeacherAddress[i];
            teachers[now_address].voted.push(false);
        }
    }

    function proposal_execute(
        uint256 idx,
        uint256 _allowFailureMap
    )public returns(bytes[] memory execResults, uint256 failureMap){
        return proposals[idx].execute_actions(_allowFailureMap);
    }

    // 设置actions
    function set_proposal_actions(
        uint256 idx,
        address fuction_address, 
        uint256 money,
        bytes memory _data // abi encode 编码) public{
    )public{
        Action memory action = Action({
            to: fuction_address,
            value: money,
            data: _data
        });
        proposals[idx].addactions(action);
    }

    // 投票逻辑
    function vote(uint256 idx, VoteChoice chioce) public{
        address now_address = msg.sender;
        teachers[now_address].voted[idx] = true;
        uint256 now_weight = teachers[now_address].token;
        proposals[idx].setvoteCounts(now_weight);
        if(chioce == VoteChoice.Approval){
            proposals[idx].setvote(now_address,1,0,0);
            teachers[now_address].choice[idx] = VoteChoice.Approval;
        }
        if(chioce == VoteChoice.Reject){
            proposals[idx].setvote(now_address,0,1,0);
            teachers[now_address].choice[idx] = VoteChoice.Reject;
        }
        if(chioce == VoteChoice.abstain){
            proposals[idx].setvote(now_address,0,0,1);
            teachers[now_address].choice[idx] = VoteChoice.abstain;
        }
        teachers[now_address].voted[idx] = true;
        teachers[now_address].token += 1;
    }

    // 添加教师
    function addTeacher(teacherKind kind, string memory _name, address teacherAddress) public {
        teacherCount++;
        teachers[teacherAddress].kind = kind;
        teachers[teacherAddress].id = teacherCount;
        teachers[teacherAddress].name = _name;
        id2TeacherAddress[teacherCount] = teacherAddress;
        teachers[teacherAddress].token = 10;
    }

    // 添加课程
    function addCourse(string memory _name) public {
        courseCount++;
        courses[courseCount].id = courseCount;
        courses[courseCount].name = _name;
    }
    
    // 课程与教师的得分
    function suitablityToTeacher(uint8 _courseId, address _teacherAddress, uint8 _suitablity) public {
        uint8 _teacherId = teachers[_teacherAddress].id;
        require(_suitablity<= 10, "Suitablity must be between 1 and 10.");
        require(courses[_courseId].suitabilityToTeacher[_teacherId]== 0, "Suitability already exists.");
        courses[_courseId].suitabilityToTeacher[_teacherId] = _suitablity;
    }

    // 初始选择一个最大评分的教师或AI
    function getBestCandidate(uint8 _courseId) internal view returns (address) {

        uint8 maxSuitability = 0;
        address bestCandidate;
        require (courseCount > 0, "No courses available.");

        // 查找最佳教师
        for (uint8 i = 1; i <= teacherCount; i++) {
            address teacherAddr = id2TeacherAddress[i];
            if(teachers[teacherAddr].assignedCourses.length >= 3) continue;
            uint8 suitability = courses[_courseId].suitabilityToTeacher[i];
            if (suitability > maxSuitability) {
                maxSuitability = suitability;
                bestCandidate = teacherAddr;
            }
        }

        return bestCandidate;
    }

    // 课程分配给教师或AI
    function allocateCourse(uint8 _courseId) public {
        address bestCandidate = getBestCandidate(_courseId);

        // 分配课程给教师
        Teacher storage teacher = teachers[bestCandidate];
        teacher.assignedCourses.push(_courseId);
    }

    // 转移课程，从fromId转移到toId
    function transferCourse(uint8 _courseId, uint8 fromId, uint8 toId) public {
        Teacher storage fromTeacher = teachers[id2TeacherAddress[fromId]];
        Teacher storage toTeacher = teachers[id2TeacherAddress[toId]];

        // 确保fromId有足够的token
        require(fromTeacher.token > 1, "From teacher must have enough token.");

        // 确保fromId对该课程的适合程度小于3
        uint8 suitabilityFrom = courses[_courseId].suitabilityToTeacher[fromId];
        require(suitabilityFrom <= 3, "From teacher suitability must be less than 3.");

        // 确保toId已分配的课程数小于3
        require(toTeacher.assignedCourses.length < 3, "To teacher has already been assigned 3 courses.");

        // 确保toId对该课程的适合程度大于等于5
        uint8 suitabilityTo = courses[_courseId].suitabilityToTeacher[toId];
        require(suitabilityTo >= 5, "To teacher suitability must be at least 5.");

        // 扣除fromId的token
        fromTeacher.token -= 2;

        // 从fromId的课程列表中移除该课程
        for (uint i = 0; i < fromTeacher.assignedCourses.length; i++) {
            if (fromTeacher.assignedCourses[i] == _courseId) {
                fromTeacher.assignedCourses[i] = fromTeacher.assignedCourses[fromTeacher.assignedCourses.length - 1];
                fromTeacher.assignedCourses.pop();
                break;
            }
        }

        // 将课程添加到toId的课程列表
        toTeacher.assignedCourses.push(_courseId);
    }

    // 请求课程函数
    function requestCourse(uint8 _courseId, uint8 fromId, uint8 toId) public {
        Teacher storage fromTeacher = teachers[id2TeacherAddress[fromId]];
        Teacher storage toTeacher = teachers[id2TeacherAddress[toId]];

        // 确保toId已分配的课程数小于3节
        require(toTeacher.assignedCourses.length < 3, "To teacher already has 3 courses.");

        // 确保fromId已分配的课程数大于1节
        require(fromTeacher.assignedCourses.length > 1, "From teacher must have more than 1 course.");

        // 确保toId的token减去1
        require(toTeacher.token > 1, "To teacher must have enough tokens.");
        toTeacher.token -= 1;

        // 确保toId对该课程的适合程度大于等于5
        uint8 suitabilityTo = courses[_courseId].suitabilityToTeacher[toId];
        require(suitabilityTo >= 5, "To teacher suitability must be at least 5.");

        // 确保toId对该课程的适合度大于等于fromId
        uint8 suitabilityFrom = courses[_courseId].suitabilityToTeacher[fromId];
        require(suitabilityTo >= suitabilityFrom, "To teacher suitability must be greater than or equal to from teacher.");

        // 如果适合度相等，则触发投票机制
        if (suitabilityTo == suitabilityFrom) {
            // 投票机制
            string memory _name = string(abi.encodePacked("change course", _courseId));
            createProposal(_name, _name, 0, 0, 0 ,0);

        } else {
            // 从fromId的课程列表中移除该课程
            for (uint i = 0; i < fromTeacher.assignedCourses.length; i++) {
                if (fromTeacher.assignedCourses[i] == _courseId) {
                    fromTeacher.assignedCourses[i] = fromTeacher.assignedCourses[fromTeacher.assignedCourses.length - 1];
                    fromTeacher.assignedCourses.pop();
                    break;
                }
            }
            // 将课程添加到toId的课程列表
            toTeacher.assignedCourses.push(_courseId);
        }
    }

    // 获取教师已分配课程的函数
    function getAssignedCourses(address _teacherAddress) public view returns (uint8[] memory) {
        return teachers[_teacherAddress].assignedCourses;
    }

    // 获取所有课程的 id 和 name
    function getAllCourses() public view returns (uint8[] memory, string[] memory) {
        uint8[] memory courseIds = new uint8[](courseCount);
        string[] memory courseNames = new string[](courseCount);

        for (uint8 i = 0; i < courseCount; i++) {
            courseIds[i] = courses[i+1].id;
            courseNames[i] = courses[i+1].name;
        }

        return (courseIds, courseNames);
    }

    function getCourseCount() public view returns (uint8){
        return courseCount;
    }
}
